import Header from './Header';

const layoutStyle = {
  marginTop: 10,
  marginBottom: 20,
  padding: 20,
  border: '1px solid #DDD'
};

const Layout = props => (
  <div>
    <Header style={layoutStyle} />
    {props.content}
  </div>
);

export default Layout;
